const getOptions = (state) => {
  return ({
    maintainAspectRatio: true,
    legend: {
      display: true
    },
    title: {
      display: true,
      text: `${state}`
    },
    tooltips: {
      bodySpacing: 4,
      mode: "nearest",
      intersect: 1,
      position: "nearest",
      xPadding: 10,
      yPadding: 10,
      caretPadding: 10
    },
    responsive: 1,
    scales: {
      yAxes: [
        {
          gridLines: {
            zeroLineColor: "transparent",
            drawBorder: false
          }
        }
      ],
      xAxes: [
        {
          display: 1,
          ticks: {
            display: false
          },
          gridLines: {
            zeroLineColor: "transparent",
            drawTicks: false,
            display: false,
            drawBorder: false
          },
          scaleLabel: {
            display: true,
            labelString: `Crops in ${state}`
          }
        }
      ]
    },
    layout: {
      padding: { left: 0, right: 0, top: 15, bottom: 15 }
    }
  })
}


const Sales = ({ state }) => {
console.log("state ",state)
  const { data, error, loading } = useQuery(GET_DATA, {
    variables: { state }
  });

if(error) return <p>Error</p>

  if (loading) {
    return <Loader style={{ marginTop: "78px", marginLeft: "123px" }} type="Rings"
      color="blue"
      height={100}
      width={100}
      timeout={300000000} />
  }
  const crops = data.getSalesByState.crops;
  const sales = data.getSalesByState.sales;

  const barData = canvas => {
    var ctx = canvas.getContext("2d");
    var gradientFill = ctx.createLinearGradient(0, 170, 0, 50);
    gradientFill.addColorStop(0, "rgba(128, 182, 244, 0)");
    gradientFill.addColorStop(1, hexToRGB("#062e04", 0.6));
    return {
      labels: crops,
      datasets: [
        {
          label: "Major Crops(Quintal)",
          backgroundColor: gradientFill,
          borderColor: "#062e04",
          pointBorderColor: "#FFF",
          pointBackgroundColor: "#062e04",
          pointBorderWidth: 2,
          pointHoverRadius: 4,
          pointHoverBorderWidth: 1,
          pointRadius: 4,
          fill: true,
          borderWidth: 1,

          data: sales
        },

      ]
    };
  }

  return (
    <div>
      <Bar
        data={barData}
        options={getOptions(state)}
      />
      ;
    </div>
  );

}

function Greeting(props) {
  const isLoggedIn = props.isLoggedIn;
  console.log(props);
  if(parseInt(isLoggedIn,10) === 0) return null;
  return <Sales state={cordinatesToState[isLoggedIn]} />
}

